import React,{useState} from 'react';

const project = ({id, screenshot,name,category}) => {
    return (
        <>
        <article>
    <p>{id}</p>
            <img src={screenshot} alt={name} />
            
        </article>
        <footer>
            <div className="project-info">
                <h4>{name}</h4>
            </div>
        </footer>
        </>
    )
}

export default project;
